@alphacharts I like your view. however, $GLD is not moving an inch in unprecedented QE period, what is the point in thinking about it longer term when tapering is started and interest rate has to go up. 

Also miners use better technology in last 5 years to dig more gold which suppress the price of precious metal. So more supply and less demand! 

Millennials are shunning the gold from both investment as well wearing it as a jewellery.  Going forward there will be less and less demand for gold. Bearish
